import React from 'react';
import { Text, View, StyleSheet, ImageBackground } from 'react-native';
import { NativeBaseProvider, Image, Button} from "native-base";
import {
  useFonts,
  PaytoneOne_400Regular
} from '@expo-google-fonts/paytone-one'
import {
  Roboto_400Regular,
} from '@expo-google-fonts/roboto'
import background from "../assets/white-dog.jpg"

const Train = () => {
  return (

    

    <NativeBaseProvider>

      <View style="">
        <Image 
          style={styles.thumbnail}
          source={require('../assets/white-dog.jpg')}
        /> 

        
      </View>

        <View style={styles.profile} > 

          <Text>contents for training pets </Text>

          <Button
            mt="2em"
            padding="1em 3em"
            borderRadius="30px"
            backgroundColor="#545871"
            onPress={() => navigation.navigate("")}
            title="Understanding requirements"
          >
            Train
          </Button>

         
        </View>


    </NativeBaseProvider>
    
  )
}

const styles = StyleSheet.create({
  thumbnail: {
    width: 100,
    height: 100,
  },
  box: {
    paddingTop: 20,
    justifyContent: 'center',
    backgroundColor: '#bbadc6',
    width: 'auto',
    paddingBottom: 20,
  },
  container: {
    textAlign: 'center',
  },
  info: {
    fontFamily: 'Roboto_400Regular',
    flexDirection: 'row',
    textAlign: 'left',
    padding: 30,
    width: 700,
    marginTop: 30,
    borderWidth: 3,
    borderRadius: 10,
    borderColor: '#89CFF0',
  },
  profile: {
    // backgroundColor: '#ffffff',
    alignItems: 'center',
    justifyContent: 'flex-start',
  },
});


export default Train;
